import React from "react";
import { useGoogleLogin } from "react-google-login";
import { useNavigate } from "react-router-dom";

// refresh token
import { refreshTokenSetup } from "../utils/refreshToken";

import "bootstrap/dist/css/bootstrap.min.css";
import "./LoginHooks.css";

const clientId =
  "615520021367-sjvmtmuujlf91gicag6u1kr4b4mu76bq.apps.googleusercontent.com";

function LoginHooks() {
  const navigate = useNavigate();

  const onSuccess = (res) => {
    console.log("Login Success: currentUser:", res.profileObj);
    const formData = new FormData();
    formData.append("first_name", res.profileObj.givenName);
    formData.append("last_name", res.profileObj.familyName);
    formData.append("name", res.profileObj.name);
    formData.append("image_url", res.profileObj.imageUrl);
    formData.append("email", res.profileObj.email);
    fetch("/loginUser", {
      method: "POST",
      body: formData,
    })
      .then((response) => response.json())
      .then((data) => {
        console.log(data);
        navigate("/", { state: data });
      })
      .catch((error) => {
        console.log(error);
      });
    refreshTokenSetup(res);
  };

  const onFailure = (res) => {
    console.log("Login failed: res:", res);
  };

  const { signIn, loaded } = useGoogleLogin({
    onSuccess,
    onAutoLoadFinished,
    clientId,
    cookiePolicy,
    loginHint,
    hostedDomain,
    autoLoad,
    isSignedIn,
    fetchBasicProfile,
    redirectUri,
    discoveryDocs,
    onFailure,
    uxMode,
    scope,
    accessType,
    responseType,
    jsSrc,
    onRequest,
    prompt,
  });
  return (
    <button onClick={signIn} className="button">
      <img src="/login2.png" alt=""></img>
    </button>
  );
}
export default LoginHooks;
